import React from 'react';
import brand from '../../assets/brand-inverse.png'

function Home(props) {


  return(
  <section id="banner">
    <div className="container-fluid">
      <div className="row">
        <div className="col-md-12">
        <img src={brand} alt="title-img"/>

        </div>

      </div>


    </div>
  </section>
  );

}

export default Home;
